package at.tuwien.seeder;

import at.tuwien.api.container.image.ImageCreateDto;
import at.tuwien.api.container.image.ImageEnvItemDto;
import at.tuwien.api.container.image.ImageEnvItemTypeDto;
import at.tuwien.entities.container.image.ContainerImageEnvironmentItem;
import at.tuwien.entities.container.image.ContainerImageEnvironmentItemType;
import at.tuwien.exception.DockerClientException;
import at.tuwien.exception.ImageNotFoundException;
import at.tuwien.service.ImageService;
import lombok.extern.log4j.Log4j2;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.annotation.Profile;
import org.springframework.stereotype.Component;

import javax.annotation.PostConstruct;
import java.util.List;

@Log4j2
@Component
@Profile("seed")
public class ImageSeeder implements Seeder {

    private final static String IMAGE_1_REPOSITORY = "postgres";
    private final static String IMAGE_1_TAG = "latest";
    private final static Integer IMAGE_1_PORT = 5432;
    private final static String IMAGE_1_DIALECT = "POSTGRES";
    private final static String IMAGE_1_DRIVER = "org.postgresql.Driver";
    private final static String IMAGE_1_JDBC = "postgresql";
    private final static String IMAGE_1_LOGO = "";

    private final static String IMAGE_2_REPOSITORY = "mysql";
    private final static String IMAGE_2_TAG = "latest";
    private final static Integer IMAGE_2_PORT = 3306;
    private final static String IMAGE_2_DIALECT = "MYSQL";
    private final static String IMAGE_2_DRIVER = "com.mysql.jdbc.Driver";
    private final static String IMAGE_2_JDBC = "mysql";
    private final static String IMAGE_2_LOGO = "";

    private final static String IMAGE_3_REPOSITORY = "mariadb";
    private final static String IMAGE_3_TAG = "latest";
    private final static Integer IMAGE_3_PORT = 3306;
    private final static String IMAGE_3_DIALECT = "MARIADB";
    private final static String IMAGE_3_DRIVER = "org.mariadb.jdbc.Driver";
    private final static String IMAGE_3_JDBC = "mariadb";
    private final static String IMAGE_3_LOGO = "";

    private final static String IMAGE_4_REPOSITORY = "mcr.microsoft.com/mssql/server";
    private final static String IMAGE_4_TAG = "2019-latest";
    private final static Integer IMAGE_4_PORT = 1433;
    private final static String IMAGE_4_DIALECT = "SQLSERVER";
    private final static String IMAGE_4_DRIVER = "com.microsoft.sqlserver.jdbc.SQLServerDriver";
    private final static String IMAGE_4_JDBC = "sqlserver";
    private final static String IMAGE_4_LOGO = "";

    private final static ImageEnvItemDto[] IMAGE_1_ENVIRONMENT = List.of(ImageEnvItemDto.builder()
                    .key("POSTGRES_USER")
                    .value("postgres")
                    .type(ImageEnvItemTypeDto.USERNAME)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("POSTGRES_PASSWORD")
                    .value("postgres")
                    .type(ImageEnvItemTypeDto.PASSWORD)
                    .build())
            .toArray(new ImageEnvItemDto[0]);

    private final static ImageEnvItemDto[] IMAGE_2_ENVIRONMENT = List.of(ImageEnvItemDto.builder()
                    .key("MYSQL_USER")
                    .value("mysql")
                    .type(ImageEnvItemTypeDto.OTHER)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("UZERNAME")
                    .value("root")
                    .type(ImageEnvItemTypeDto.USERNAME)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("MYSQL_PASSWORD")
                    .value("mysql")
                    .type(ImageEnvItemTypeDto.OTHER)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("MYSQL_ROOT_PASSWORD")
                    .value("mysql")
                    .type(ImageEnvItemTypeDto.PASSWORD)
                    .build())
            .toArray(new ImageEnvItemDto[0]);

    private final static ImageEnvItemDto[] IMAGE_3_ENVIRONMENT = List.of(ImageEnvItemDto.builder()
                    .key("MARIADB_USER")
                    .value("mariadb")
                    .type(ImageEnvItemTypeDto.OTHER)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("UZERNAME")
                    .value("root")
                    .type(ImageEnvItemTypeDto.USERNAME)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("MARIADB_PASSWORD")
                    .value("mariadb")
                    .type(ImageEnvItemTypeDto.OTHER)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("MARIADB_ROOT_PASSWORD")
                    .value("mariadb")
                    .type(ImageEnvItemTypeDto.PASSWORD)
                    .build())
            .toArray(new ImageEnvItemDto[0]);

    private final static ImageEnvItemDto[] IMAGE_4_ENVIRONMENT = List.of(ImageEnvItemDto.builder()
                    .key("ACCEPT_EULA")
                    .value("Y")
                    .type(ImageEnvItemTypeDto.OTHER)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("SA_PASSWORD")
                    .value("sqlserver")
                    .type(ImageEnvItemTypeDto.PASSWORD)
                    .build(),
            ImageEnvItemDto.builder()
                    .key("UZERNAME")
                    .value("sa")
                    .type(ImageEnvItemTypeDto.USERNAME)
                    .build())
            .toArray(new ImageEnvItemDto[0]);

    private final static ImageCreateDto IMAGE_1_CREATE_DTO = ImageCreateDto.builder()
            .repository(IMAGE_1_REPOSITORY)
            .tag(IMAGE_1_TAG)
            .defaultPort(IMAGE_1_PORT)
            .dialect(IMAGE_1_DIALECT)
            .driverClass(IMAGE_1_DRIVER)
            .jdbcMethod(IMAGE_1_JDBC)
            .environment(IMAGE_1_ENVIRONMENT)
            .logo(IMAGE_1_LOGO)
            .build();

    private final static ImageCreateDto IMAGE_2_CREATE_DTO = ImageCreateDto.builder()
            .repository(IMAGE_2_REPOSITORY)
            .tag(IMAGE_2_TAG)
            .defaultPort(IMAGE_2_PORT)
            .dialect(IMAGE_2_DIALECT)
            .driverClass(IMAGE_2_DRIVER)
            .jdbcMethod(IMAGE_2_JDBC)
            .environment(IMAGE_2_ENVIRONMENT)
            .logo(IMAGE_2_LOGO)
            .build();

    private final static ImageCreateDto IMAGE_3_CREATE_DTO = ImageCreateDto.builder()
            .repository(IMAGE_3_REPOSITORY)
            .tag(IMAGE_3_TAG)
            .defaultPort(IMAGE_3_PORT)
            .dialect(IMAGE_3_DIALECT)
            .driverClass(IMAGE_3_DRIVER)
            .jdbcMethod(IMAGE_3_JDBC)
            .environment(IMAGE_3_ENVIRONMENT)
            .logo(IMAGE_3_LOGO)
            .build();

    private final static ImageCreateDto IMAGE_4_CREATE_DTO = ImageCreateDto.builder()
            .repository(IMAGE_4_REPOSITORY)
            .tag(IMAGE_4_TAG)
            .defaultPort(IMAGE_4_PORT)
            .dialect(IMAGE_4_DIALECT)
            .driverClass(IMAGE_4_DRIVER)
            .jdbcMethod(IMAGE_4_JDBC)
            .environment(IMAGE_4_ENVIRONMENT)
            .logo(IMAGE_4_LOGO)
            .build();

    private final ImageService imageService;

    @Autowired
    public ImageSeeder(ImageService imageService) {
        this.imageService = imageService;
    }

    @Override
    @PostConstruct
    public void seed() throws DockerClientException, ImageNotFoundException {
        if (imageService.getAll().size() > 0) {
            return;
        }
        log.debug("seeded image {}", imageService.create(IMAGE_1_CREATE_DTO));
        log.debug("seeded image {}", imageService.create(IMAGE_2_CREATE_DTO));
        log.debug("seeded image {}", imageService.create(IMAGE_3_CREATE_DTO));
//        log.debug("seeded image {}", imageService.create(IMAGE_4_CREATE_DTO));
    }

}
